  false,\n\t\"url\": null,\n\t\"notes\": \"This 1988 Annual Big Game Hunting Program
  outlines the reasons and regulations for white-tailed deer hunting on Parker River
  National Wildlife Refuge.  The white-tailed deer population has grown to exceed
  the recommended carrying capacity for the Island.  The Refuge will be closed for
  10 days in order to carry out the controlled deer hunt.  Limited hunting will be
  allowed by permit only; the bag limit is two deer, one daily and the first deer
  must be antlerless.  Rules and procedures for hunter selection are attached.\",\n\t\"owner_org\":
